export const items = [{"id":2,"name":"Hublot Original Gold 44mm","description":" Daring, powerful, original and technical.","image":"https://www.hublot.com/sites/default/files/styles/watch_item_desktop_2x/public/big-bang-original-gold-44-mm-301.PX.130.RX-soldier-shot.png?itok=0EHXUo1Y","price":"33100.00","category":{"id":3,"name":"Watches"}},{"id":1,"name":"Hublot Titanium 45mm","description":"Elegance reinvented.","image":"https://www.hublot.com/sites/default/files/styles/watch_item_desktop_2x/public/2020-06/Classic-Fusion-Titanium-on-Rubber-45-mm.png?itok=5h2Z4aJA","price":"7200.00","category":{"id":3,"name":"Watches"}},{"id":3,"name":"Hublot Big Bang One Click King Gold White Diamonds 39mm","description":"A culmination of Hublot’s “Art of Fusion” for those who share the same spirit of independence.","image":"https://www.hublot.com/sites/default/files/styles/watch_item_desktop_2x/public/big-bang-one-click-king-gold-white-diamonds-39-mm-465.OE.2080.RW.1204-soldier-shot.png?itok=PdlEM0Pk","price":"26900.00","category":{"id":3,"name":"Watches"}},{"id":4,"name":"Omega Speedmaster 38 co-axial chronometer chronograph 38mm","description":"The Speedmaster 38 mm collection has been crafted with simplicity, size and colour in mind, yet still retains the look and heritage of OMEGA’s most famous chronograph.","image":"https://www.omegawatches.com/media/catalog/product/cache/a5c37fddc1a529a1a44fea55d527b9a116f3738da3a2cc38006fcc613c37c391/o/m/omega-speedmaster-speedmaster-38-32468385002003-l.png","price":"19500.00","category":{"id":3,"name":"Watches"}},{"id":5,"name":"Omega Constellation Co‑Axial Master Chronometer 29 mm","description":"The dramatic and enduring design of the OMEGA Constellation is characterised by its famous half-moons, “claws” on the case and mono-rang bracelet.","image":"https://www.omegawatches.com/media/catalog/product/cache/a5c37fddc1a529a1a44fea55d527b9a116f3738da3a2cc38006fcc613c37c391/o/m/omega-constellation-13155292053003-l.png","price":"28600.00","category":{"id":3,"name":"Watches"}},{"id":6,"name":"Patek Philippe 5327G Grand Complications","description":"A new self-winding perpetual calendar has been added to the Patek Philippe collection. It comes in a Calatrava case with beautifully scalloped lugs and applied Breguet numerals.","image":"https://static.patek.com/images/articles/face_white/350/5327G_001_1.jpg","price":"70000.00","category":{"id":3,"name":"Watches"}},{"id":7,"name":"Patek Philippe 6119G Calatrava","description":"Patek Philippe gives fresh momentum to the emblematic Calatrava model featuring a guilloched hobnail pattern also known as Clous de Paris by treating it to a slightly larger diameter and a design reinterpreted in a contemporary spirit. The faceted applied white gold hour-markers, combined with dauphine-style hours/minutes hands, create a sleek and timeless dial aesthetic. The elegantly refined white gold case houses the new manually wound movement 30-255 PS with a 65-hour power reserve.","image":"https://static.patek.com/images/articles/face_white/350/6119G_001_1.jpg","price":"36500.00","category":{"id":3,"name":"Watches"}},{"id":8,"name":"Rolex Submariner Oyster 41mm","description":"It features a unidirectional rotatable bezel and solid-link Oyster bracelet. The latest generation Submariner and Submariner Date remain faithful to the original model launched in 1953. In watchmaking, the Submariner represented a historic turning point; it set the standard for divers’ watches.","image":"https://content.rolex.com/dam/model-page/gallery/m124060-0001/model-page-submariner_m124060-0001_2001ac_006_rvb_medium_1.jpg","price":"8450.00","category":{"id":3,"name":"Watches"}},{"id":9,"name":"Rolex Oyster Perpetual 41mm","description":"The aesthetics of the Oyster Perpetual models set them apart as symbols of universal and classic style. They embody timeless form and function, firmly rooted in the pioneering origins of Rolex.","image":"https://content.rolex.com/dam/model-page/gallery/m124300-0001/model-page-oyster-perpetual-41_m124300-0001_2001ac_004_medium_1.jpg","price":"5750.00","category":{"id":3,"name":"Watches"}},{"id":11,"name":"Audemars Piguet CODE 11.59","description":"Launched in 2019, Code 11.59 by Audemars Piguet writes a new page in the Manufacture’s history. The contemporary evolution of a classic round watch, it presents a multifaceted and curved architecture with more details than meet the eyes.","image":"https://www.audemarspiguet.com/content/dam/ap/com/products/watches/MTR008899.00/importer/standup.png.transform.approductmain.png","price":"40000.00","category":{"id":3,"name":"Watches"}},{"id":10,"name":"Audemars Piguet Royal Oak","description":"With its steel case, octagonal bezel, “Tapisserie” dial and integrated bracelet, the Royal Oak overturned the prevailing codes in 1972 and took its rightful place as a modern icon.","image":"https://www.audemarspiguet.com/content/dam/ap/com/products/watches/MTR009022.00/importer/standup.png.transform.approductmain.png","price":"26000.00","category":{"id":3,"name":"Watches"}},{"id":13,"name":"Homo Faber by Max Frisch","description":"Walter Faber is an emotionally detached engineer forced by a string of coincidences to embark on a journey through his past.","image":"https://images-na.ssl-images-amazon.com/images/I/71xcM9wXExS.jpg","price":"29.95","category":{"id":4,"name":"Books"}},{"id":14,"name":"Siddhartha by Herman Hesse","description":"Herman Hesse's classic novel has delighted, inspired, and influenced generations of readers, writers, and thinkers. In this story of a wealthy Indian Brahmin who casts off a life of privilege to seek spiritual fulfillment. Hesse synthesizes disparate philosophies--Eastern religions, Jungian archetypes, Western individualism--into a unique vision of life as expressed through one man's search for true meaning.","image":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Vorzugsausgabe_der_Erstauflage_von_1922.JPG","price":"29.95","category":{"id":4,"name":"Books"}},{"id":12,"name":"Heidi by Johanna Spyri","description":"Heidi is a work of children's fiction published in 1881 by Swiss author Johanna Spyri, originally published in two parts as Heidi: her years of wandering and learningand Heidi : How she used what she learned. It is a novel about the events in the life of a young girl in her grandfather's care, in the Swiss Alps. It was written as a book \"for children and those who love children\" . Heidi is one of the best-selling books ever written and is among the best-known works of Swiss literature.","image":"https://images.saymedia-content.com/.image/t_share/MTc2NDYxODAwMTEwMzAzMTk0/heidi-the-bestselling-childrens-classic-novel.jpg","price":"29.95","category":{"id":4,"name":"Books"}},{"id":15,"name":"Delphine by Germaine de Staël","description":"Delphine is the first novel by Anne Louise Germaine de Staël, published in 1802. The book is written in epistolary form (as a series of letters) and examines the limits of women's freedom in an aristocratic society.","image":"https://images-na.ssl-images-amazon.com/images/I/81I7hAmr7NL.jpg","price":"29.95","category":{"id":4,"name":"Books"}},{"id":16,"name":"Emile, or On Education by Jean-Jacques Rousseau","description":"Emile, or On Education is a treatise on the nature of education and on the nature of man written by Jean-Jacques Rousseau, who considered it to be the \"best and most important of all my writings.\" Due to a section of the book entitled \"Profession of Faith of the Savoyard Vicar,\" Emile was banned in Paris and Geneva and was publicly burned in 1762. During the French Revolution, Emile served as the inspiration for what became a new national system of education.","image":"https://kbimages1-a.akamaihd.net/11c38c44-7ebc-4bb4-a864-c175806ab665/1200/1200/False/emile-or-concerning-education-3.jpg","price":"29.95","category":{"id":4,"name":"Books"}},{"id":17,"name":"The Pollen Room by Zöe Jenny","description":"Jo watches her mother's ritual of bereavement over the death of her second husband. Jo's father had been her first husband. Jo is torn between the father who raised her and the mother who left her for 12 years, but who may now at last need her help.","image":"https://www.fairmondo.de/system/images/015/812/306/original/20180329_154625.jpg?1522332243","price":"29.95","category":{"id":4,"name":"Books"}},{"id":18,"name":"Fly Away, Pigeon by Melinda Nadj Abonji","description":"With tough-minded nostalgia and compassionate realism, Fly Away, Pigeon illustrates how much pain and loss even the most successful immigrant stories contain. It is a work that is intensely local, while grounded in the histories and cultures of two distinctive communities. Its emotions and struggles are universal in the human dilemmas it portrays.","image":"https://images-na.ssl-images-amazon.com/images/I/61k26v4n8IL.jpg","price":"29.95","category":{"id":4,"name":"Books"}},{"id":19,"name":"Switzerland Travel Guide by Lonely Planet","description":"Look beyond the chocolate, cuckoo clocks and yodelling – contemporary Switzerland, land of four languages, is all about once-in-a-lifetime journeys, heart-racing Alpine pursuits and urban culture. Lonely Planet will get you to the heart of Switzerland, with amazing travel experiences and the best planning advice.","image":"https://lonelyplanet-weblinc.netdna-ssl.com/product_images/lonely_planet_us/switzerland-travel-guide-9/pdp/5aef97e70409ee2d14d5ca85/pdp_main.jpg","price":"29.95","category":{"id":4,"name":"Books"}},{"id":20,"name":"Hunter Pro Alox by Victorinox","description":"Meet the Hunter Pro Alox – the sleek and handy every day carry for the modern man. Its iconic design and perfect form combined with the sturdy blade make it the ideal cross-over from outdoor to urban jungle. Standout feature are the hugely popular Alox scales, known and loved for their durability. Aesthetically it’s a hit too; the subtle shimmering finish showcases the knife’s key parts with style. Add in the new smart clip, spring integrated lanyard hole and paracord pendant and you have hunting’s new generation go-to multitool.","image":"https://imageengine.victorinox.com/mediahub/35937/560Wx490H/SAK_0_9415_M26__S1.jpg","price":"119.99","category":{"id":5,"name":"Swiss Army Knives"}},{"id":21,"name":"Herculex by Victorinox","description":"Small, yet mighty, the Hercules is our pocket knife with super strength. A natural multitasker, it packs a powerful 18 functions into its compact size. Think of it as your take-anywhere toolbox. Integrated combi pliers, a long and thin Phillips screwdriver, reamer, punch, wood saw, scissors and a larger blade are just a few of its powers.","image":"https://imageengine.victorinox.com/mediahub/33360/560Wx490H/SAK_0_8543__S1.jpg","price":"74.99","category":{"id":5,"name":"Swiss Army Knives"}},{"id":22,"name":"Cheese Master by Victorinox","description":"Exceptional cheese and exacting engineering are just two of Switzerland’s finest exports. Introducing the Cheese Master, the pioneering compact pocket knife that fuses both of these national passions. Part cheese knife, part fondue fork, this clever hybrid effortlessly slices through holey Emmental and nutty Gruyère then doubles to tackle your cheese fondue. Created in collaboration with the Switzerland Cheese Marketing AG, this knife will give your board some global clout.","image":"https://imageengine.victorinox.com/mediahub/95572/560Wx490H/SAK_0-8313-W_S1.jpg","price":"44.99","category":{"id":5,"name":"Swiss Army Knives"}},{"id":23,"name":"Ranger Grip by Victorinox","description":"The Ranger Grip 61 is always ready to support you in everything you do. Its large locking blade features a thumbhole so it can be opened with just one hand; and its dual density scales ensure excellent grip as you get to work. Like all of the knives in the Ranger series, it's made for skilled craftsmen and tested by professionals.","image":"https://imageengine.victorinox.com/mediahub/33481/560Wx490H/SAK_0_9563_MC__S1.jpg","price":"62.99","category":{"id":5,"name":"Swiss Army Knives"}},{"id":24,"name":"Cyber Tool by Victorinox","description":"The Cyber Tool is made for the best technicians. Taking the Victorinox legend into the digital age, this pocket knife comes with a bit wrench to open, fix and close any kind of IT gadget. Keeping the look of the traditional Officer's knife, the Cyber Tool has everything you need to become the master of digital transformation.","image":"https://imageengine.victorinox.com/mediahub/33888/560Wx490H/SAK_1_7725_T__S1.jpg","price":"119.99","category":{"id":5,"name":"Swiss Army Knives"}},{"id":25,"name":"Traveller by Victorinox","description":"Whether you're conquering the highest peak or just enjoying a relaxing weekend camping by the lake, the Traveler Lite is the perfect companion. Hassle-free: it has it all. With 30 functions including an altimeter, stopwatch and LED light, the Traveler Lite will help you take on the day from the moment you wake up to sunrise to watch the sun rise over the mountains.","image":"https://imageengine.victorinox.com/mediahub/33919/560Wx490H/SAK_1_7905_AVT__S1.jpg","price":"139.99","category":{"id":5,"name":"Swiss Army Knives"}},{"id":26,"name":"Toblerone Milk","description":"Smooth Swiss milk chocolate with delectable honey and almond nougat. Unique triangles of delicious milk chocolate to give as a gift or share with family and friends.","image":"http://images.sweetauthoring.com/product/10007162.png","price":"15.98","category":{"id":1,"name":"Chocolate"}},{"id":27,"name":"Toblerone Crunchy Almonds","description":"Enjoy Toblerone, the iconic triangular chocolate from Switzerland, with a twist. The beloved Toblerone milk chocolate is now enriched with the crunchiness of caramelised almonds and a surprising sprinkling of salt. This travel-exclusive pack contains 360g Toblerone Crunchy Almonds – a perfect gift with a surprising taste. Made in Switzerland.","image":"http://images.sweetauthoring.com/product/10007161.png","price":"17.98","category":{"id":1,"name":"Chocolate"}},{"id":28,"name":"Toblerone Dark","description":"The Toblerone bar is now available in a dark chocolate version with honey nougat and almonds in a black packaging.","image":"http://images.sweetauthoring.com/product/10007163.png","price":"19.98","category":{"id":1,"name":"Chocolate"}},{"id":29,"name":"Toblerone White","description":"Enjoy Toblerone, the iconic triangular chocolate from Switzerland with Honey and Almond Nougat. This travel-exclusive pack contains 360g Toblerone White Chocolate – a perfect gift for anyone who loves white chocolate. Made in Switzerland.","image":"http://images.sweetauthoring.com/product/10007164.png","price":"17.98","category":{"id":1,"name":"Chocolate"}},{"id":30,"name":"Toblerone Fruit & Nut","description":"Enjoy Toblerone, the iconic triangular chocolate from Switzerland with Honey and Almond Nougat. This pack contains 100g Toblerone Milk Chocolate with Raisins - an ideal treat for sharing and snacking while traveling or at home. Made in Switzerland.","image":"http://images.sweetauthoring.com/product/10007165.png","price":"17.98","category":{"id":1,"name":"Chocolate"}},{"id":31,"name":"Lindt Lindor Kugeln Assortiert 1000g","description":"Experience true moments of happiness with LINDOR - the finest whole milk chocolate with a melt-in-the-mouth filling (44%). When the fine chocolate shell breaks, the infinitely melt-in-the-mouth filling seduces your senses and gently carries them away.","image":"https://www.lindt.ch/media/catalog/product/b/5/b58f46b64284d00ace2214b936c582d972ba13523c080ec17055f662841df364.jpeg","price":"34.99","category":{"id":1,"name":"Chocolate"}},{"id":32,"name":"Lindt Lindor Kugeln Milch 1000g","description":"Experience true moments of happiness with LINDOR. When the fine chocolate shell breaks, the infinitely melt-in-the-mouth filling seduces your senses and gently carries them away. Whether as a gift or for a personal moment at home, LINDOR is for every occasion. Enjoy the delicacies of LINDOR, the closely guarded secret of our Lindt Maîtres Chocolatiers.","image":"https://www.lindt.ch/media/catalog/product/b/5/b58f46b64284d00ace2214b936c582d972ba13523c080ec17055f662841df364.jpeg","price":"34.99","category":{"id":1,"name":"Chocolate"}},{"id":33,"name":"Cailler Winter 248g","description":"It's Christmas time and the animals around Maison Cailler are excitedly peeking through the forest in anticipation of the first Christmas chocolates for the festive season. Surprise your friends and family with a piece of Cailler Christmas magic. Each praline has been lovingly created and chosen to enhance a special moment.","image":"https://cailler.ch/sites/site.prod2.cailler.ch/files/product_large_7bea2605-922b-4f69-bf7f-26de57bf0b30.jpg","price":"14.95","category":{"id":1,"name":"Chocolate"}},{"id":34,"name":"Cailler Fémina Winter 500g","description":"Marché de Noël. Avelotte; Delicate hazelnut cream with a hint of caramel. Bûchette; Precious Gianduja with crispy splinters. Gianduja; Exquisite hazelnut cream coated in chocolate. Malakoff; Delicate almonds in a smooth and crispy praline. Marquise; Delicately melting hazelnut cream with almond pieces. Mocca; Gianduja with soft cocoa and fragrant coffee note. Dentelle; The intensity of cocoa, in harmony with roasted almonds and hazelnuts and crispy bricelets. A stroll over the Christmas market and you will see our delicate masterpieces in an elegant silver dress. Lift the curtains for their big performance during the holidays. To make the eyes of every gourmet shine, we have dressed up our beloved Gianduja chocolates for Christmas. For magical moments of pleasure full of warmth at a crackling fire.","image":"https://cailler.ch/sites/site.prod2.cailler.ch/files/product_large_f79e9e76-27e4-4f46-b69e-930d8340f2ca.png","price":"28.95","category":{"id":1,"name":"Chocolate"}},{"id":35,"name":"Cailler Ambassador Gifting 296g","description":"Be amazed by the luxurious chocolate creations of our chocolatiers. Melting gently, crisp and crunchy and covered in the finest milk chocolate. Our irresistible delicacies with the finest ingredients bring a smile to your lips. To indulge, share, give as a gift. For special moments.","image":"https://cailler.ch/sites/site.prod2.cailler.ch/files/product_large_dd60bf91-66fa-4621-829d-dce5524a2f0e.png","price":"22.95","category":{"id":1,"name":"Chocolate"}},{"id":36,"name":"Gruyere Cheese 1000g","description":"Gruyère (pronounced \"groo-YAIR\") is a smooth-melting type of Swiss cheese that's made from whole cow's milk and generally cured for six months or longer. Gruyère is a great table cheese, a term that refers to any cheese that can be eaten in slices, like on a sandwich or as part of a cheese platter.","image":"https://www.thespruceeats.com/thmb/EvodydtywEM0R-iMB6J-mz9RyhQ=/940x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/wheel-of-cut-gruyere-cheese-on-a-table-with-a-knife-179313182-c1033ccf75f54802b4bdac89a4aa435d.jpg","price":"23.15","category":{"id":2,"name":"Cheese"}},{"id":37,"name":"Emmental Cheese 1000g","description":"Emmenthal is a semihard Swiss cow's milk cheese. It is distinguished by large walnut-sized holes or \"eyes\" formed during the fermentation process. It ranges from mild and buttery to fruity and full-flavored, depending on its maturity. It has good melting properties and is a traditional ingredient in cheese fondue. ","image":"https://www.thespruceeats.com/thmb/luSdm-29wOi9Bopys_vFdpeHzPw=/940x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/GettyImages-71285433-57ec06383df78c690f425031.jpg","price":"18.65","category":{"id":2,"name":"Cheese"}},{"id":38,"name":"Appenzeller Cheese 1000g","description":"Appenzeller® cheese is one of the greats when it comes to cheese specialities from Switzerland. The most flavoursome cheese in Switzerland has been produced by hand in line with old traditions for over 700 years.","image":"https://www.cheesesfromswitzerland.com/fileadmin/_processed_/e/6/csm_APP_Composing_Food_MwKwEwEdelwRaessw_April_2019_d_cmyk_korrigiert_cd53f1ab51.jpg","price":"28.50","category":{"id":2,"name":"Cheese"}},{"id":39,"name":"Raclette Cheese 1000g","description":"Swiss raclette cheese that is lactose-free and can therefore be enjoyed by everyone. The cheese is made from cow's milk and has a smooth character thanks to a fat percentage of 42%. The cheese melts very pleasantly, making it very suitable for raclette.","image":"https://alpanddellcheese.com/wp-content/uploads/2018/02/Emmi-Swiss-Raclette-Cheese.jpg","price":"21.90","category":{"id":2,"name":"Cheese"}}]